import './Sidebar.css';

function Sidebar() {
  return (
    <div className="sidebar">
      <ul>
        <li>Menu One</li>
        <li>Menu Two</li>
        <li>Menu Three</li>
        <li>Menu Four</li>
        <li>Menu Five</li>
        <li>Menu Six</li>
        <li>Menu Seven</li>
        <li>Menu Eight</li>
        <li>Menu Nine</li>
        <li>Menu Ten</li>
      </ul>
    </div>
  );
}

export default Sidebar;
